import React from 'react';
import { Text, View } from 'react-native';

export default function UnimportantScreen() {
    return (
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>Unimportant Notifications!</Text>
      </View>
    );
}
